Barba.Prefetch.init();
Barba.Pjax.start();

var FadeTransition = Barba.BaseTransition.extend({
   start: function() {
      Promise
	 .all([this.newContainerLoading, this.fadeOut()])
	 .then(this.fadeIn.bind(this));
	 Gallery.init();
	 GalleryMenu.init();

   },

   fadeOut: function() {
      return $(this.oldContainer).animate({
	 opacity: 0,
	 top: 15
      }, 400).promise();
   },

   fadeIn: function() {
      var _this = this;
      var $el = $(this.newContainer);

      $(this.oldContainer).hide();

      $el.css({
	 visibility : 'visible',
	 opacity : 0
      });

      $el.animate({ opacity: 1 }, 300, function() {
	 _this.done();
      });
   }
});

var GalleryMenu = Barba.BaseView.extend({
   namespace: 'gallery-menu',
   onEnter: function() {
      var tl = new TimelineMax();
      tl.staggerFromTo( '.gallery-menu', 2,
	 { y: 15, opacity: 0 },
	 { y: 0, opacity: 1, ease: Expo.easeOut }, 0.1, .7)
   },
   onLeave: function() {
      var tl = new TimelineMax();
      tl.fromTo( $(this.oldContainer), 2,
	 { y: 0, opacity: 1 },
	 { y: 15, opacity: 0, ease: Expo.easeOut }, 0.1, .7)
   },
});

var Gallery = Barba.BaseView.extend({
   namespace: "gallery",
   onEnter: function() {
      var tl = new TimelineLite();
      tl
	 .to( $("header"), 0.7, { y: -15, opacity: 0, ease: Expo.easeIn,
	    onComplete: function() { $("header").hide(); }
	 }, 0)
	 .fromTo( ".back", 0.5,
	    { opacity: 0, x: -15, },
	    { opacity: 1, x: 0 }, 1)
   },
   onLeave: function() {
      var tl = new TimelineLite();
      tl
	 .fromTo( ".back", 0.5,
	    { opacity: 1, x: 0, },
	    { opacity: 0, x: -15,
	       onComplete: function() { $("header").show(); }
	    })
	 .to( $("header"), 0.7, { y: 0, opacity: 1, ease: Expo.easeOut })
   },
});

Barba.Pjax.getTransition = function() {
   return FadeTransition;
};
